import { useState } from "react";
import { useNavigate } from "react-router-dom";
import useStateRef from "react-usestateref";
import { useParams } from "react-router-dom";
import { useEffect } from "react";
import "../ExamMaster/Createexam.css";

const CreateExamMaster = () => {
  const params = useParams();
  var ExamId = params.examId;
  console.log("Exam Idd...>", ExamId);
  const navigate = useNavigate();
  const [hasError, setHasError, hasNoError] = useStateRef(false);


  var examId;
  var initialvalues = {};

  //   if(ExamId !==null && ExamId!== undefined && ExamId !==''){
  //     // ExamDetails(ExamId);
  //     console.log('initial::::::',initialvalues);
  //     console.log("EEEExamId..>",examId);

  //     //Window.location.reload();
  //    showButton();
  //    <input type="reset" value="Reset" />

  //   }else{
  //    initialvalues={
  //   examId : '',
  //   examName : '',
  //   description : '',
  //   creationDate: '',
  //   expirationDate: '',
  //   noOfQuestions:'',
  //   enableNegativeMark:'',
  //   negativeMarkValue:'',
  //   passPercentage:'',
  //   durationMinutes:'',
  //   questionsRandomized:'',
  //   answersMust:'',
  // }
  //   }
  const [formValues, setFormValues] = useStateRef(initialvalues);

  function showButton() {
    console.log("show button called...>");
    return (
      <div id="button1">
        <button className="btn btn-primary">Back</button>
      </div>
    );
  }

  useEffect(() => {
      if (ExamId !== "" && ExamId !== undefined && ExamId !== null) {
      console.log("exam Details is called....");
      console.log(ExamId);

      let map = {
        ExamId: ExamId,
      };

      async function ExamDetails(examId) {
        const response = await fetch(
          "https://localhost:8443/onlineexam/control/examMasterListEvent",
          {
            method: "POST",
            credentials: "include",
            body: JSON.stringify(map),
            headers: {
              "Content-type": "application/json",
            },
          }
        );

        const result = await response.json();
        const text = result.ExamData;
        console.log("text....>", text);
        // setFormValues(text);
        //setExamList(text);
        text.map((obj, value) => {
          console.log("inside map::::: exam id::::", obj.examId);
          initialvalues.examId = obj.examId;
          initialvalues.examName = obj.examName;
          initialvalues.description = obj.description;
          initialvalues.creationDate = obj.creationDate;
          initialvalues.expirationDate = obj.expirationDate;
          initialvalues.noOfQuestions = obj.noOfQuestions;
          initialvalues.passPercentage = obj.passPercentage;
          initialvalues.durationMinutes = obj.durationMinutes;
          initialvalues.questionsRandomized = obj.questionsRandomized;
          initialvalues.answersMust = obj.answersMust;
          initialvalues.enableNegativeMark = obj.enableNegativeMark;
          initialvalues.negativeMarkValue = obj.negativeMarkValue;
        });
      }
      ExamDetails(ExamId);
    } else {
      initialvalues = {
        examId: "",
        examName: "",
        description: "",
        creationDate: "",
        expirationDate: "",
        noOfQuestions: "",
        enableNegativeMark: "",
        negativeMarkValue: "",
        passPercentage: "",
        durationMinutes: "",
        questionsRandomized: "",
        answersMust: "",
      };
    }
  }, []);

  // console.log('id........',obj.examId);

  // setexamid(obj.examId);
  // setexamname(obj.examName);
  // setdescription(obj.description);
  // setcreationdate(obj.creationDate);
  // setexpirationdate(obj.expirationDate);
  // setnoofquestions(obj.noOfQuestions);
  // setpasspercentage(obj.passPercentage);
  // setdurationminutes(obj.durationMinutes);
  // setquestionsrandomized(obj.questionsRandomized);
  // setanswersmust(obj.answersMust);
  // setenablenegativemark(obj.enableNegativeMark);
  // setnegativemarkvalue(obj.negativeMarkValue);

  // console.log("result...", result.ExamTopicNameMapping.ExamTopicMapping);
  // const output = result.ExamTopicNameMapping.ExamTopicMapping;
  // console.log("output..........", output);
  // output.map((obj, value) => {
  //   examname = obj.examName;
  //   console.log(examname);
  //   SetexamName(examname);
  // });
  // console.log("My exam Name....", examname);
  // const myexamname = JSON.stringify(examname);
  // console.log("myexamname..........", myexamname);
  // examname = myexamname;
  // setTopicData([...result.ExamTopicNameMapping.ExamTopicMapping]);
  // console.log("topic data...", result.ExamTopicNameMapping.ExamTopicMapping);

  // console.log("***********************************************");
  // console.log("NAREN - MASTER");

  // console.log("topicData....", topicData);

  // console.log("examName.............", examname);

  // Object.entries(obj).map(([key,value],index)=>{
  //   Object.entries(value).map(([key,value])=>{
  //     console.log("key--"+key)
  //     console.log("value---"+value)
  //     console.log("index---",index)
  //   })
  // })

  const submittingForm = (e) => {
    console.log("Form submittted....");
    e.preventDefault();
    const data = new FormData(e.target);
    setHasError(false);
    handleErrors();

    const myobject = Object.fromEntries(data.entries());
    Object.entries(myobject).map(([key, value], keyIndex) => {
      validateExamMaster(key, value);
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const formElement = document.getElementById("myform");
    const data = new FormData(formElement);
    handleErrors();

    const examId = data.get("examId");
    console.log("examId-----", examId);
    const examName = data.get("examName");
    const description = data.get("description");
    const creationDate = data.get("creationDate");
    const expirationDate = data.get("expirationDate");
    const noOfQuestions = data.get("noOfQuestions");
    const durationMinutes = data.get("durationMinutes");
    const passPercentage = data.get("passPercentage");
    const questionsRandomized = data.get("questionsRandomized");
    const answersMust = data.get("answersMust");
    const enableNegativeMark = data.get("enableNegativeMark");
    const negativeMarkValue = data.get("negativeMarkValue");

    const myobject = Object.fromEntries(data.entries());
    Object.entries(myobject).map(([key, value], keyIndex) => {
      validateformexammaster(key, value);
    });

    function validateformexammaster(key, value) {
      switch (key) {
        case "examId": {
          if (value == "" || value == null) {
            // alert("examId should not be em")
          }
        }
      }
    }

    const map = {
      examId: examId,
      examName: examName,
      description: description,
      creationDate: creationDate,
      expirationDate: expirationDate,
      noOfQuestions: noOfQuestions,
      durationMinutes: durationMinutes,
      passPercentage: passPercentage,
      questionsRandomized: questionsRandomized,
      answersMust: answersMust,
      enableNegativeMark: enableNegativeMark,
      negativeMarkValue: negativeMarkValue,
    };
    console.log(map);
    if (!hasNoError.current) {
      fetch("https://localhost:8443/onlineexam/control/ExamMasterEvent", {
        method: "POST",
        body: JSON.stringify(map),
        headers: {
          "Content-Type": "application/json",
          Accept: "application/json",
        },
      })
        .then((response) => alert("Value added succesfully"))
        .catch((err) => console.log("ERROR FROM FETCH", err));
    }
  };

  function handleErrors() {
    document.getElementById("p1").classList.add("d-none");
    document.getElementById("p2").classList.add("d-none");
    document.getElementById("p2").classList.innerHTML = "";
    document.getElementById("p3").classList.add("d-none");
    document.getElementById("p3").classList.innerHTML = "";
    document.getElementById("p4").classList.add("d-none");
    document.getElementById("p4").classList.innerHTML = "";
    document.getElementById("p5").classList.add("d-none");
    document.getElementById("p5").classList.innerHTML = "";
    document.getElementById("p6").classList.add("d-none");
    document.getElementById("p6").classList.innerHTML = "";
    document.getElementById("p7").classList.add("d-none");
    document.getElementById("p7").classList.innerHTML = "";
    document.getElementById("p8").classList.add("d-none");
    document.getElementById("p8").classList.innerHTML = "";
    document.getElementById("p9").classList.add("d-none");
    document.getElementById("p9").classList.innerHTML = "";
    document.getElementById("p10").classList.add("d-none");
    document.getElementById("p10").classList.innerHTML = "";
    document.getElementById("p11").classList.add("d-none");
    document.getElementById("p11").classList.innerHTML = "";
    document.getElementById("p12").classList.add("d-none");
    document.getElementById("p12").classList.innerHTML = "";
    setHasError(false);
  }

  const validateExamMaster = (key, value) => {
    switch (key) {
      case "examId":
        if (value === null || value === "") {
          document.getElementById("p1").classList.remove("d-none");
          document.getElementById("p1").classList.add("d-block");
          document.getElementById("p1").innerHTML = "Please enter a examId";
          setHasError(true);
        }
        break;
      case "examName":
        if (value == "" || value == null) {
          document.getElementById("p2").classList.remove("d-none");
          document.getElementById("p2").classList.add("d-block");
          document.getElementById("p2").innerHTML = "Please enter a examName";
          setHasError(true);
        }
        break;

      case "description":
        if (value == "" || value == null) {
          document.getElementById("p3").classList.remove("d-none");
          document.getElementById("p3").classList.add("d-block");
          document.getElementById("p3").innerHTML =
            "Please enter a description";
          setHasError(true);
        }

      case "creationDate":
        if (value == "" || value == null) {
          document.getElementById("p4").classList.remove("d-none");
          document.getElementById("p4").classList.add("d-block");
          document.getElementById("p4").innerHTML =
            "Please enter a creation date";
          setHasError(true);
        }
        break;

      case "expirationDate":
        if (value == "" || value == null) {
          document.getElementById("p5").classList.remove("d-none");
          document.getElementById("p5").classList.add("d-block");
          document.getElementById("p5").innerHTML =
            "Please enter a expiration date";
          setHasError(true);
        }
        break;

      case "noOfQuestions":
        if (value == "" || value == null) {
          document.getElementById("p6").classList.remove("d-none");
          document.getElementById("p6").classList.add("d-block");
          document.getElementById("p6").innerHTML =
            "Please enter a noOfQuestions";
          setHasError(true);
        }
        break;

      case "durationMinutes":
        if (value == "" || value == null) {
          document.getElementById("p7").classList.remove("d-none");
          document.getElementById("p7").classList.add("d-block");
          document.getElementById("p7").innerHTML =
            "Please enter a durationMinutes";
          setHasError(true);
        }
        break;

      case "passPercentage":
        if (value == "" || value == null) {
          document.getElementById("p8").classList.remove("d-none");
          document.getElementById("p8").classList.add("d-block");
          document.getElementById("p8").innerHTML =
            "Please enter a passPercentage";
          setHasError(true);
        }
        break;

      case "questionsRandomized":
        if (value == "" || value == null) {
          document.getElementById("p9").classList.remove("d-none");
          document.getElementById("p9").classList.add("d-block");
          document.getElementById("p9").innerHTML =
            "Please enter a questionsRandomized";
          setHasError(true);
        }
        break;

      case "answersMust":
        if (value == "" || value == null) {
          document.getElementById("p10").classList.remove("d-none");
          document.getElementById("p10").classList.add("d-block");
          document.getElementById("p10").innerHTML =
            "Please enter a answersMust";
          setHasError(true);
        }
        break;

      case "enableNegativeMark":
        if (value == "" || value == null) {
          document.getElementById("p11").classList.remove("d-none");
          document.getElementById("p11").classList.add("d-block");
          document.getElementById("p11").innerHTML =
            "Please enter a enableNegativeMark";
          setHasError(true);
        }
        break;

      case "negativeMarkValue":
        if (value == "" || value == null) {
          document.getElementById("p12").classList.remove("d-none");
          document.getElementById("p12").classList.add("d-block");
          document.getElementById("p12").innerHTML =
            "Please enter a negativeMarkValue";
          setHasError(true);
        }
        break;

      default: {
        console.log("FOrm validated successfully...");
      }
    }
  };

  return (
    <>
      <div className="container my-3">
        <legend className="rounded-pill bg-primary text-white">
          Create Exam
        </legend>
        <div className="col-10 mx-auto">
          <form className="d-flex" id="myform" onSubmit={handleSubmit}>
            <div className="col-5">
              <div className="mb-3">
                <label
                  htmlFor="exampleInputEmail1"
                  hidden
                  className="form-label float-start"
                >
                  ExamId*:
                </label>
                <input
                  type="text"
                  id="examid"
                  className="form-control "
                  name="examId"
                  value={formValues.examId}
                  // onChange={(e)=>setexamid(e.target.value)}
                />
                <p id="p1" className="text-danger"></p>
              </div>
              <div className="mb-3">
                <label
                  htmlFor="exampleInputEmail1"
                  className="form-label float-start"
                >
                  Exam Name:
                </label>
                <input
                  type="text"
                  id="examname"
                  className="form-control"
                  name="examName"
                  value={formValues.examName}
                  // onChange={(e)=>setexamname(e.target.value)}
                />
                <p id="p2" className="text-danger"></p>
              </div>
              <div className="mb-3">
                <label
                  htmlFor="exampleInputEmail1"
                  className="form-label float-start"
                >
                  Description:
                </label>
                <input
                  type="text"
                  id="description"
                  className="form-control"
                  placeholder="Description"
                  name="description"
                  value={formValues.description}
                  // defaultValue={description}
                />
                <p id="p3" className="text-danger"></p>
              </div>
              <div className="mb-3">
                <label htmlFor="" className="form-label float-start">
                  Creationdate:
                </label>
                <input
                  type="datetime-local"
                  id="creationdate"
                  className="form-control"
                  name="creationDate"
                  value={formValues.creationDate}
                />
                <p id="p4" className="text-danger"></p>
              </div>
              <div className="mb-3">
                <label
                  htmlFor="exampleInputEmail1"
                  className="form-label float-start"
                >
                  Expiration Date:
                </label>
                <input
                  type="datetime-local"
                  id="expirationdate"
                  className="form-control"
                  name="expirationDate"
                  value={formValues.expirationDate}
                />
                <p id="p5" className="text-danger"></p>
              </div>
              <div className="mb-3">
                <label
                  htmlFor="exampleInputPassword1"
                  className="form-label float-start"
                >
                  NoOfQuestions:
                </label>
                <input
                  type="text"
                  id="noofquestions"
                  className="form-control"
                  placeholder="No of questions"
                  name="noOfQuestions"
                  value={formValues.noOfQuestions}
                  // onChange={(e)=>setnoofquestions(e.target.value)}
                />
                <p id="p6" className="text-danger"></p>
              </div>
            </div>

            <div className="col-5 offset-1">
              <div className="mb-3">
                <label
                  htmlFor="exampleInputEmail1"
                  className="form-label float-start"
                >
                  Duration Minutes:
                </label>
                <input
                  type="text"
                  id="durationminutes"
                  placeholder="Duration Minutes eg(60-Minutes)"
                  name="durationMinutes"
                  className="form-control"
                  value={formValues.durationMinutes}
                />
                <p id="p7" className="text-danger"></p>
              </div>
              <div className="mb-3">
                <label
                  htmlFor="exampleInputEmail1"
                  className="form-label float-start"
                >
                  Passpercentage:
                </label>
                <input
                  type="text"
                  id="passpercentage"
                  placeholder="pass-percentage eg(25%)"
                  name="passPercentage"
                  className="form-control"
                  value={formValues.passPercentage}
                />
                <p id="p8" className="text-danger"></p>
              </div>
              <div className="mb-3">
                <label
                  htmlFor="exampleInputEmail1"
                  className="form-label float-start"
                >
                  QuestionsRandomized:
                </label>
                <input
                  type="text"
                  name="questionsRandomized"
                  className="form-control"
                  id="questionsrandomized"
                  placeholder="questions randomized eg(Yes or No)"
                  value={formValues.questionsRandomized}
                />
                <p id="p9" className="text-danger"></p>
              </div>
              <div className="mb-3">
                <label
                  htmlFor="exampleInputEmail1"
                  className="form-label float-start"
                >
                  Answers Must:
                </label>
                <input
                  type="text"
                  name="answersMust"
                  placeholder="To Answer is must eg(Y OR N)"
                  id="answersmust"
                  className="form-control"
                  value={formValues.answersMust}
                />
                <p id="p10" className="text-danger"></p>
              </div>
              <div className="mb-3">
                <label
                  htmlFor="exampleInputEmail1"
                  className="form-label float-start"
                >
                  EnableNegativeMark:
                </label>
                <input
                  type="text"
                  name="enableNegativeMark"
                  placeholder="Enablenegativemark eg(Y OR N)"
                  id="enablenegativemark"
                  className="form-control"
                  value={formValues.enableNegativeMark}
                />
                <p id="p11" className="text-danger"></p>
              </div>
              <div className="mb-3">
                <label
                  htmlFor="exampleInputEmail1"
                  className="form-label float-start"
                >
                  NegativeMarkValue:
                </label>
                <input
                  type="text"
                  placeholder="Negativemarkvalue eg(0.25)"
                  id="negativemarkvalue"
                  name="negativeMarkValue"
                  className="form-control"
                  value={formValues.negativeMarkValue}
                />
                <p id="p12" className="text-danger"></p>
              </div>

              <div>
                <button className="btn btn-primary offset-9">Submit</button>
              </div>
            </div>
          </form>
        </div>
      </div>
      <button type="submit" className="btn btn-primary" id="button1">
        Back
      </button>
    </>
  );
};

export default CreateExamMaster;
